Information
------------------------------

Cheetahs Of The Deep 
A new study has revealed that pilot whales are &quot;the cheetahs of the deep sea,&quot; making high-speed, all-or-nothing dives to chase and catch large prey before surfacing to catch their breath. Such sprinter-like dives stand in stark contrast to the longer, slower, and more conservative dives of other whale species that have been studied.
Marine mammal researchers working off the Canary Islands attached non-invasive, temporary tags, known as D-tags, to 23 whales to digitally record movements during their 15-minute dives, as well as the sounds that they make and hear. Researchers analyzed the recorded &quot;clicks,&quot; &quot;buzzes,&quot; and other whale sounds, together with the whales' recorded speeds, orientations, and depths, to reconstruct a picture of the whales' hunts. The tags recorded movement, sound, and depth for one day, after which they disconnected and floated to the surface for collection.

